"use strict";
// Basic DataType
{
    // String
    let firstName = "Jerin";
    // Number
    let roll = 123;
    // Boolean
    let isAdmin = true;
    // Undefine
    let x = undefined;
    // Null
    let y = null;
    // Anytype
    let d;
    d = 123;
    d = "dnff";
    d = true;
    // Array
    let friends = ["a", "b"];
    friends.push("c");
    console.log(friends);
    let eligibleRollList = [38, 74];
    // tuple ---> array --->order --> type of value
    let coordinates = [1, 5];
    let ageName = [23, "jerin"];
    let ageNameBool = [23, "jerin", true];
}
